import { Avatar } from "@mui/material";
import moment from "moment";

const name = {
  type: "string",
};

export const organisationTable = [
  {
    field: "initials",
    headerName: "ðŸ¢",
    headerAlign: "center",
    width: 60,
    editable: true,
    renderCell: (params) => {
      return <Avatar>{params.value}</Avatar>;
    },
  },
  {
    field: "name",
    headerName: "Business Name",
    editable: true,
    width: 250,
  },
  {
    field: "city",
    headerName: "City",
    width: 150,
    editable: true,
  },
  {
    field: "gstin",
    headerName: "GSTIN",
    width: 180,
    editable: true,
  },
];

export const vehicleTable = [
  {
    field: "initials",
    headerName: "ðŸšš",
    headerAlign: "center",
    sx: {
      fontSize: 50,
    },
    width: 20,
  },
  {
    field: "vehicleNumber",
    headerName: "Vehicle Number",
    width: 250,
  },
  {
    field: "make",
    headerName: "Make",
    width: 150,
  },
  {
    field: "model",
    headerName: "Model",
    width: 180,
  },
];

export const branchTable = [
  {
    field: "initials",
    headerName: "ðŸ¢",
    headerAlign: "center",
    width: 20,
  },
  {
    field: "branchName",
    headerName: "Branch Name",
    width: 250,
  },
  {
    field: "city",
    headerName: "City",
    width: 150,
    valueGetter: (params) => {
      return `${JSON.parse(params.row.city).structured_formatting.main_text}`;
    },
  },
];

export const partyTable = [
  {
    field: "name",
    headerName: "Name",
    width: 250,
  },
  {
    field: "city",
    headerName: "City",
    width: 250,
    valueGetter: (params) => {
      return `${JSON.parse(params.row.city).description}`;
    },
  },
  {
    field: "mobile",
    headerName: "Mobile",
    width: 150,
  },
];

export const driverTable = [
  {
    field: "initials",
    headerName: "ðŸ¢",
    headerAlign: "center",
    width: 20,
  },
  {
    field: "name",
    headerName: "Name",
    width: 250,
  },
  {
    field: "mobile",
    headerName: "Mobile",
    width: 150,
  },
];

export const orderTable = [
  {
    field: "initials",
    headerName: "ðŸšš",
    headerAlign: "center",
    sx: {
      fontSize: 50,
    },
    width: 20,
  },
  {
    field: "orderNo",
    headerName: "Order No",
    width: 250,
  },
  {
    field: "saleDate",
    headerName: "Date",
    width: 250,
    valueGetter: (params) => {
      console.log(params);
      if (params.value) {
        return moment(params.value).format("d/m/yy");
      }
    },
  },
  {
    field: "customer",
    headerName: "Customer",
    width: 250,
    valueGetter: (params) => {
      console.log(params);
      if (params.value) {
        return params.value.name;
      }
    },
  },
];
